#!/usr/bin/env ruby

require 'stringio'

def parse_input(input)
  input.readline

  input.readline.strip.split(' ').map(&:to_i)
end

def cumsum(array)
  sum = 0
  array.map do |elem|
    sum += elem
    sum
  end
end

def main(input, output)
  x = parse_input(input)

  a = cumsum(x)
  b = cumsum(x.reverse).reverse

  index_l = 0
  index_r = 0

  n_max = x.size
  y = Array.new(n_max) { 0 }

  1.upto(n_max) do |n|
    if index_l == n - 1
      index_l = b[0..(n - 1)].max
    end
    if index_r < n
      index_r = a[(n - 1)..].max
      index_r = index_r + n - 1
    end
    if index_l > 1
      y[n] = a[index_r - 1] - a[index_l - 2]
    else
      y[n] = a[index_r - 1]
    end
  end

  y
end

